import React from "react";

const SearchItemComponent = () => {
	return (
		<>
			<div
				className="text-white p-3 d-flex gap-3 align-items-center search_result"
				key={result.mal_id}
				style={{ cursor: "pointer" }}
			>
				<img
					src={result.image}
					alt=""
					style={{
						width: "50px",
						height: "50px",
					}}
				/>
				<div>
					<p className="m-0" style={{ overflowX: "hidden" }}>
						{result.title}
					</p>
					<p className="text-muted small m-0">
						<strong>Score:</strong> {result.score} |{" "}
						<strong>Rank:</strong> #{result.rank}
					</p>
					<p className="text-muted small m-0">
						<strong>Status:</strong> {result.status}
					</p>
				</div>
			</div>
			<hr className="m-0" />
		</>
	);
};

export default SearchItemComponent;
